def calculate_probability(n, r):

    def factors(n):
        count = []
        for i in range(1, int(n ** 0.5) + 1):
            if n % i == 0:
                count.append(i)
                if i != n // i:
                    count.append(n // i)
        return len(set(count))

    def gcd(a, b):
        while b:
            (a, b) = (b, a % b)
        return a

    def find_total(n, r):
        return n + factors(r - 1)
    p = find_total(n, r)
    q = n
    gc = gcd(p, q)
    return (p // gc, q // gc)

